create table shuffling_figure
(
    id           BIGINT(19) auto_increment
        primary key,
    name         VARCHAR(255) null,
    is_enable    VARCHAR(255) null,
    jurisdiction VARCHAR(255) null,
    url_link     VARCHAR(255) null,
    content      TEXT(65535)  null,
    create_time  BIGINT(19)   null
)
    collate = utf8_bin;

